import * as React from 'react';
import { SVGProps } from 'react';

const IconSortDownSizeXs = (props: SVGProps<SVGSVGElement>) => (
  <svg viewBox="0 0 12 12" xmlns="http://www.w3.org/2000/svg" {...props}>
    <path d="M11 3v1H1V3h10zM8 6v1H1V6h7zm-3 4V9H1v1h4z" />
  </svg>
);
export default IconSortDownSizeXs;
